import { Typography } from '@mui/material'
import { Container } from '@mui/system'
import { Box } from '@mui/system'
import React from 'react'

function Footer() {
  return (
    <Container sx={{
        backgroundColor: 'primary.main',
        width: '100%',
        position: 'fixed',
        bottom: '0px',
        padding: '2em'
    }}>
        <Box sx={{
            align: 'right'
        }}>
            <Typography>
                All rights reserved 2022
            </Typography>
        </Box>
    </Container>
  )
}

export default Footer
